// import './App.css';

function App() {
  return (
   <>
   <div className="container">
     <input type="text" placeholder="search" />
     <i class="fa-solid fa-magnifying-glass"></i>
     <button>Submit</button>
   </div>
  </>
  );
}

export default App;
